import React from 'react';
import styles from '../../styles/components/admin_navbar2.module.scss';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import NavbarBtn from '../layout/NavbarBtn';


const AdminNavbar2 = () => {
    return (
        <div className="navbar">

            <NavbarBtn><FontAwesomeIcon icon="home" /></NavbarBtn>
        </div>
    );
}

export default AdminNavbar2;
